import React from "react";
import WDLogo from '../../assets/WolvesDAO-White.png';
import "./partners.css";

const Partners = () => (
  <div className="partners section__padding" id="partners">
    <div className="partners-heading">

      <h1 className="gradient__text">WolvesDAO Partners</h1>
    </div>
  </div>
);

export default Partners;
